# 01 Matrix
from typing import List

class Solution:
    def checkAdjacent(self, matrix: List[List[int]], i: int, j: int) -> int:
        if i == 0:
            ans = matrix[i][j - 1]
        elif j == 0:
            ans = matrix[i - 1][j]
        else:
            ans = min(matrix[i][j - 1], matrix[i - 1][j])
        return ans + 1

    def checkAdjacentAgain(self, matrix: List[List[int]], i: int, j: int) -> int:
        n = len(matrix)
        m = len(matrix[0])
        if i == n - 1:
            ans = matrix[i][j + 1]
        elif j == m - 1:
            ans = matrix[i + 1][j]
        else:
            ans = min(matrix[i][j + 1], matrix[i + 1][j])
        return ans + 1


    def updateMatrix(self, matrix: List[List[int]]) -> List[List[int]]:
        n = len(matrix)
        m = len(matrix[0])
        zeros = []
        for i in range(n):
            for j in range(m):
                if matrix[i][j] == 0:
                    zeros.append((i,j))

        min0, minn = 10000, 10000
        for (a, b) in zeros:
            if a + b < min0:
                min0 = a + b
            if n - 1 - a + (m - 1 - b) < minn:
                minn = n - 1 - a + (m - 1 - b)

        matrix[0][0], matrix[n - 1][m - 1] = min0, minn

        for i in range(n):
            for j in range(m):
                if i == 0 and j == 0:
                    continue
                elif i == n - 1 and j == m - 1:
                    continue
                if matrix[i][j] == 0:
                    continue
                matrix[i][j] = self.checkAdjacent(matrix, i, j)

        for i in range(n - 1, -1, -1):
            for j in range(m - 1, -1, -1):
                if i == n - 1 and j == m - 1:
                    continue
                if i == 0 and j == 0:
                    continue
                if matrix[i][j] == 0:
                    continue
                if self.checkAdjacentAgain(matrix, i, j) < matrix[i][j]:
                    matrix[i][j] = self.checkAdjacentAgain(matrix, i, j)

        return matrix


